import "./BioDetails.css";

export const BioDetails = (props) => {
  return (
    <div className="container-bio-details">
      <span className="purple-text">{props.name}</span>
      <p>{props.description}</p>
      <div className="details-items">

        <li>React Router</li>
        <li>Ui Design</li>
      </div>
    </div>
  );
};
